import { Route, Routes } from 'react-router-dom';
import HomePage from './components/HomePage';
import About from './components/About';
function App() {

    const linkedinUrl = 'https://www.linkedin.com/in/cole-kedzierski';
    const githubUrl = 'https://github.com/ColeKedz';

    return (
        <div className='App'>
            <header className="App-header">
                <span ><a className='navFonts' href={linkedinUrl} target='_blank' rel='noreferrer' >Linkedin</a></span>
                <span><a id='GitHub' class='navFonts' href={githubUrl} target='_blank' rel='noreferrer'>GitHub</a></span>
            </header>

        <Routes>
                <Route path="/reactGames" element={<HomePage />} />
                <Route path="/About" element={<About /> } />
        </Routes>      
        </div>

    );
}

export default App;
